import axios from 'axios'

export default () => {
  return dispatch => 
  axios
    .get('https://cors-anywhere.herokuapp.com/https://www.arnoldclark.com/used-cars/search.json?payment_type=monthly&min_price=100&max_price=150&sort_order=monthly_payment_up')
    .then((response) => {
      dispatch({ payload: response.data });
    })
    .catch((err) => {
      console.error(err);
    });
};
